import './App.css';
import Home from './pages/Home';
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="app">
      <BrowserRouter>
      <Routes>
        <Route>
        <Route path="/search">
           hi search page
          </Route>
          <Route path="/" element={<Home />} />

        </Route>
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
